import './App.css';
import PrimarySearchAppBar from './components/AppBar';
import { Typography } from '@material-ui/core';

function App() {
  return (
    <div className="App">
      <PrimarySearchAppBar/>
      <Typography sx={{ mt: 5 }} variant="h3" component="h3">
        Learning <code>React</code>, Woo!
      </Typography>
    </div>
  );
}

export default App;
